//React core
import React from "react";

// other info
import information from "./information.json";

import { Routes, Route, useParams } from 'react-router-dom';

//Components
import Card from "./components/Card";

const Page = () => {
  const {id} = useParams();
  return <iframe title={id} width="560" height="315" src={`//mixdrop.co/e/${id}`} frameborder="0" allowfullscreen></iframe>
}

function App() {

  return (
    <>
      <Routes>
        <Route path="/" element={<div className="box features"><div className="row">{information.files.map(data => <Card data={data}></Card>)}</div></div>} />
        <Route path="/page/:id" element={<Page />} />
      </Routes>
    </>
  );
}

export default App;
